export const Log_in = (formData, setFormData, navigate) => {
  if (formData.ID === "") {
    alert("아이디를 입력하세요");
    return;
  }
  if (formData.PW === "") {
    alert("비밀번호를 입력하세요");
    return;
  }

  alert(JSON.stringify(formData));
};
